import React, { useEffect } from "react";
import FullCalendar from "@fullcalendar/react";
import timeGridPlugin from "@fullcalendar/timegrid";
import { useSelector } from "react-redux";
import { API } from "../../util/api/Api.js";
import { SelectCurrentUser } from "../../store/user/UserSelector";
import DefaultImage from "../../../logo/default-home.jpg";
import "./home.css";

let api = new API();

const cronDetails = {
  currentDate: "Wed, 26 Dec 2012 12:38:53 UTC",
  endDate: "Wed, 26 Dec 2012 14:40:00 UTC",
  cron: "0 * 8-23 ?  * MON,TUE,WED,THU,FRI",
};

function Home(props) {
  const currentUser = useSelector(SelectCurrentUser);

  const getTriggerTimes = () => {
    console.log("pressed");
    return new Promise((resolve) => {
      api.getTriggerTimes(cronDetails)
        .then((res) => {
          resolve(res.data);
          console.log("hello");
          console.log(res.data);
        })
        .catch((err) => {
          console.log(err);
        });
    });
  };

  return (
    <div>
      {currentUser ? (
        <div>
          <button onClick={getTriggerTimes}>Click me</button>
          <FullCalendar
            plugins={[timeGridPlugin]}
            initialView="timeGridDay"
            allDaySlot={false}
            eventMinHeight={20}
            eventClick={
              function(arg){
                alert(arg.event.title)
                alert(arg.event.start)
              }
            }
            slotDuration="00:05:00"
            events={[
              {
                title: "Event 1",
                start: "2022-04-20T14:39:00",
                end: "2022-04-20T14:40:00",
              },
              {
                title: "Event 2",
                start: "2022-04-19T09:00:00",
                end: "2022-04-19T09:01:00",
              },
              {
                title: "Event 3",
                start: "2022-04-19T09:00:00",
                end: "2022-04-19T09:01:00",
              },
              {
                title: "Event 4",
                start: "2022-04-19T09:00:00",
                end: "2022-04-19T09:01:00",
              },
              {
                title: "Event 5",
                start: "2022-04-19T09:45:00",
                end: "2022-04-19T09:46:00",
              },
              {
                title: "Event 6",
                start: "2022-04-19T09:45:00",
                end: "2022-04-19T09:46:00",
              },
              {
                title: "Event 7",
                start: "2022-04-19T09:45:00",
                end: "2022-04-19T09:46:00",
              },
              {
                title: "Event 8",
                start: "2022-04-19T09:45:00",
                end: "2022-04-19T09:46:00",
              },
              {
                title: "Event 9",
                start: "2022-04-19T09:45:00",
                end: "2022-04-19T09:46:00",
              },
              {
                title: "Event 10",
                start: "2022-04-19T09:45:00",
                end: "2022-04-19T09:46:00",
              },
            ]}
          />
        </div>
      ) : (
        <img className="bg-image" src={DefaultImage} alt="Default Home Page" />
      )}
    </div>
  );
}

export default Home;
